import React from "react";
import { Box, Grid, Typography, Button} from '@material-ui/core'


export default props => {
    return(
        <Box>
        <Grid container>
            <Grid item xs>
                <Typography variant="h4">Frontend Developer</Typography>
               
                <Typography variant="h4">Google</Typography>
            </Grid>
            <Grid item xs> </Grid>
            <Grid item xs> </Grid>
        </Grid>
        </Box>
        
        )

    }
